import { StyleSheet, Text, View, TextInput, Button } from 'react-native';
import * as React from 'react';
import { useState } from 'react/cjs/react.development';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { useNavigation } from '@react-navigation/native';
import { atan } from 'react-native-reanimated';


export function Roi({route}) {
    
    
    
    
    
    console.log(route)
    console.log(route.params.usage-route.params.energy)
    console.log(route.params.cost/route.params.usage)
    
    
    return(
        <View style = {styles.container}>
            <Text>
                Estimated Cost of Solar Panels 
            </Text>
            <Text>
                ${route.params.state}
            </Text>
            <Text>
                Estimated Cost of Solar Panels After Incentive
            </Text>
            <Text>
                ${route.params.state*0.74}
            </Text>
            <Text>
                Estimated Electricity Bill Per Month
            </Text>
            <Text>
                ${(route.params.usage)*(route.params.cost/route.params.usage)}
            </Text>
        </View>
    )

}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: 'white',
      alignItems: 'center',
      justifyContent: 'center',
    },
    input: {
      borderWidth: 1,
      borderColor: '#777',
      padding: 8,
      margin: 10,
      width: 200,
  
    }
  });
